    show_id UUID PRIMARY KEY,
    show_name VARCHAR(255),
    viewership_count INT,
    viewer_demographics JSON
);

CREATE TABLE TV_Shows (
    show_id INT PRIMARY KEY,
    show_name VARCHAR,
    genre VARCHAR,
    release_date DATE
);

CREATE TABLE Viewers (
    viewer_id INT PRIMARY KEY,
    viewer_name VARCHAR,
    age INT,
    gender VARCHAR
);

CREATE TABLE Viewership (
    viewer_id INT,
    show_id INT,
    viewing_date DATE,
    duration_minutes INT
);

CREATE TABLE Ratings (
    show_id INT,
    viewer_id INT,
    rating FLOAT,
    review VARCHAR
);

